import React from 'react';
import {Autocomplete} from '@material-ui/lab'

function Header(props) {
  return (
  <div>
    <Autocomplete
        freeSolo
        id="free-solo-2-demo"
        disableClearable
        options={[].map(option => option.title)}
        renderInput={params => (
          <TextField
            {...params}
            label="Search input"
            margin="normal"
            variant="outlined"
            fullWidth
            InputProps={{ ...params.InputProps, type: 'search' }}
          />
        )}
      />
    <input type="text" value={props.query} onChange={ (e) => props.setQuery(e.target.value)}></input>
  </div>
  );
}

export default Header;
